// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "../node_modules/@openzeppelin/contracts/security/Pausable.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "../node_modules/@openzeppelin/contracts/utils/Counters.sol";
import "../node_modules/@openzeppelin/contracts/security/PullPayment.sol";


// ERC721 es el estandar de los NFTs que utilizaremos para la coleccin. Ms informacin en https://eips.ethereum.org/EIPS/eip-721
// ERC721Enumerable es una extensin de ERC721 que permite listar los tokens de un usuario. Ms informacin en https://eips.ethereum.org/EIPS/eip-721
// ERC721URIStorage es una extensin de ERC721 que permite almacenar los metadatos de los tokens. Ms informacin en https://eips.ethereum.org/EIPS/eip-721
// Pausable es un contrato que permite pausar la transferencia de tokens. Ms informacin en https://docs.openzeppelin.com/contracts/4.x/api/security#Pausable
// Ownable es un contrato que permite establecer un propietario del contrato. Ms informacin en https://docs.openzeppelin.com/contracts/4.x/api/access#Ownable
// ERC721Burnable es una extensin de ERC721 que permite quemar tokens. Ms informacin en https://docs.openzeppelin.com/contracts/4.x/api/token/erc721#ERC721Burnable
// Counters es una librera que permite llevar la cuenta de tokens. Ms informacin en https://docs.openzeppelin.com/contracts/4.x/api/utils#Counters
// PullPayment es un contrato que permite realizar pagos. Ms informacin en https://docs.openzeppelin.com/contracts/4.x/api/payment#PullPayment

contract ID3Minter is ERC721, ERC721Enumerable, ERC721URIStorage, Pausable, Ownable, ERC721Burnable, PullPayment {


    /* El modificador onlyOwner permite que solo el propietario del contrato pueda ejecutar la funcin a la que se le aplica */

    // Usamos la librera Counters para llevar la cuenta de tokens y asignar el ID de cada token. Se declara la variable _tokenIdCounter para ello.
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdCounter;   

    uint256 public tokenPrice; // Precio de cada token
    address private ownerWallet; // Direccin del propietario del contrato

    // En el constructor establecemos el nombre y el smbolo de la coleccin

    constructor(uint256 _initialPrice, address _ownerWallet) ERC721("ID3Proof", "ID3PC") {

        tokenPrice = _initialPrice; // Establecemos el precio de cada token. Merakis Collection en Mumbai es de 10000000000000000 wei (0.01 ETH)
        ownerWallet = _ownerWallet; // Establecemos la direccin del propietario del contrato
        _tokenIdCounter.increment();

    }

    // La funcin pause() permite pausar la transferencia de tokens. Solo el propietario del contrato puede ejecutarla.

    function pause() public onlyOwner {
        _pause();
    }

    // La funcin unpause() permite reanudar la transferencia de tokens. Slo el propietario del contrato puede ejecutarla.

    function unpause() public onlyOwner {
        _unpause();
    }

    // La funcin safeMint() permite crear un nuevo token y asignarlo a una direccin. Solo el propietario del contrato puede ejecutarla.

    function safeMint(string memory uri)
        public
        onlyOwner
    {   

        _safeMint(_msgSender(), _tokenIdCounter.current());
        _setTokenURI(_tokenIdCounter.current(), uri);
        _tokenIdCounter.increment();
    }

    // La funcin collectMeraki() permite crear un nuevo token y asignarlo a la direccin que la ejecuta. El usuario debe enviar suficiente MATIC para comprar el token.

    function collectMeraki(string memory uri)
    external
    payable
    whenNotPaused
    {
    require(msg.value >= tokenPrice, "Not enough MATIC sent; check price!"); // Comprobamos que el usuario ha enviado suficiente MATIC para comprar el token


        _safeMint(_msgSender(), _tokenIdCounter.current());
        _setTokenURI(_tokenIdCounter.current(), uri);
        _asyncTransfer(ownerWallet, msg.value); // Enviamos el MATIC al propietario del contrato
        _tokenIdCounter.increment();

    }

    //La funcin setPrice() permite establecer un nuevo precio para los tokens. Solo el propietario del contrato puede ejecutarla.

    function setPrice(uint256 _newPrice) external onlyOwner{

        tokenPrice = _newPrice;

    }

    // La funcin setOwnerWallet() permite establecer una nueva direccin para el propietario del contrato. Solo el propietario del contrato puede ejecutarla.

    function setOwnerWallet(address _newOwnerWallet) external onlyOwner{

        ownerWallet = _newOwnerWallet;

    }

    // La funcin getCurrentTokenId() permite obtener el ID del ltimo token creado.

    function getCurrentTokenId() public view returns (uint256) {
        return _tokenIdCounter.current();
    }

    /* Las siguientes funciones son overrides de las funciones de los contratos que heredamos,
       son necesarias para el correcto funcionamiento del contrato */

    function _beforeTokenTransfer(address from, address to, uint256 tokenId, uint256 batchSize)
        internal
        whenNotPaused
        override(ERC721, ERC721Enumerable)
    {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    // La funcin _burn() permite quemar un token

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    // La funcin tokenURI() permite obtener los metadatos de un token

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    // La funcin supportsInterface() permite comprobar si el contrato soporta una interfaz determinada

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable, ERC721URIStorage)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
